  `},{id:"masque-visage-banane",name:"Masque Visage Banane",img:"/niall-cosmetique/images/soin16.webp",description:"Découvrez le secret d'une peau éclatante et nourrie avec notre masque visage à la banane. Infusé avec les bienfaits naturels de la banane, ce masque offre une hydratation intense pour une peau douce et souple. La banane est riche en vitamines, minéraux et antioxydants qui aident à nourrir la peau en profondeur, favorisant ainsi son élasticité et sa luminosité. Sa texture crémeuse pénètre en profondeur dans les couches de la peau, laissant une sensation de fraîcheur et de revitalisation.",ingredients:"Aqua/Eau, Cetyl Alcohol, Ceteareth-20, Phenoxythanol, Caprylic, Huile de banane, Vitamine E.",bienfaits:["Hydratation :Les bananes sont riches en potassium et en eau, ce qui les rend excellentes pour hydrater la peau sèche. Elles aident à restaurer l’hydratation naturelle de la peau, la rendant plus douce et plus souple.","Nourrissante :Les bananes contiennent des vitamines A, C, et E, ainsi que des minéraux comme le zinc et le fer, qui nourrissent la peau en profondeur. Elles aident à renforcer la barrière cutanée et à maintenir la santé de la peau.","Éclat de la peau :Les acides gras naturels présents dans les bananes aident à maintenir l’équilibre du pH de la peau, ce qui peut contribuer à un teint plus éclatant et plus uniforme.","Anti-âge :Les antioxydants présents dans les bananes aident à lutter contre les dommages causés par les radicaux libres, ce qui peut réduire l’apparence des rides et des ridules et prévenir le vieillissement prématuré de la peau.","Apaisante :Les propriétés anti-inflammatoires des bananes les rendent idéales pour apaiser les irritations cutanées, les rougeurs et les inflammations. Elles sont douces et conviennent même aux peaux sensibles."],utilisation:`

