  `},{id:"masque-visage-thé-vert",name:"Masque Visage Thé Vert",img:"/niall-cosmetique/images/soin12.webp",description:"Offrez à votre peau une pause revitalisante avec notre masque visage au thé vert. Infusé avec les bienfaits apaisants et antioxydants du thé vert, ce masque aide à purifier la peau en profondeur tout en éliminant les impuretés et les toxines. Sa formule légère et rafraîchissante pénètre rapidement dans la peau, laissant une sensation de fraîcheur et d'hydratation.",ingredients:"Aqua/Eau, Cetyl Alcohol, Ceteareth-20, Phenoxythanol, Caprylic, Huile essentielle d’arbre à thé.",bienfaits:["Antioxydant puissant : Le thé vert est riche en polyphénols, des composés antioxydants qui aident à protéger la peau contre les dommages causés par les radicaux libres, aidant ainsi à prévenir le vieillissement prématuré de la peau et à maintenir son élasticité.","Purification de la peau : Les catéchines présentes dans le thé vert ont des propriétés antibactériennes et antivirales qui aident à nettoyer la peau en profondeur, en éliminant les impuretés et les toxines, ce qui peut aider à prévenir les éruptions cutanées et l’acné.","Apaisement des irritations cutanées : Le thé vert contient des composés anti-inflammatoires qui aident à calmer les rougeurs, les irritations et les inflammations cutanées, ce qui en fait un ingrédient idéal pour les peaux sensibles ou sujettes aux rougeurs.","Réduction de l’apparence des pores : Les tanins présents dans le thé vert ont des propriétés astringentes naturelles qui resserrent les pores de la peau, aidant ainsi à réduire leur apparence et à donner à la peau un aspect plus lisse et plus uniforme.","Éclat et vitalité de la peau : En favorisant la circulation sanguine et en stimulant le renouvellement cellulaire, le thé vert aide à donner à la peau un éclat naturel et une apparence plus saine et revitalisée."],utilisation:`

